import { GamesComponent } from '../../../widgets/GamesComponent';
import { MimesisComponent } from '../../../widgets/MimesisComponent';

export const MainPage = () => {
  const [isVisible, setIsVisible] = useState(true);
  return (
    <div>
      <MimesisComponent />
      <GamesComponent />
      <Bottom />
      {isVisible && <GameInfo />}
    </div>
  );
};
